import React, { useState, useEffect } from 'react';
import {
  Box,
  Grid,
  Paper,
  Typography,
  TextField,
  IconButton,
  CircularProgress,
  useTheme,
  useMediaQuery,
  InputAdornment,
  Button,
  Card,
  CardContent,
} from '@mui/material';
import { Search as SearchIcon, Star as StarIcon, TrendingUp as TrendingIcon } from '@mui/icons-material';
import { useWeb3React } from '@web3-react/core';
import { Coin } from '../types/Coin';
import { HyperEVMService } from '../services/hyperevm';
import PlaceholderImage from './PlaceholderImage';

const hyperEVMService = new HyperEVMService();

const CoinTracker: React.FC = () => {
  const { account } = useWeb3React();
  const [coins, setCoins] = useState<Coin[]>([]);
  const [loading, setLoading] = useState(true);
  const [search, setSearch] = useState('');
  const [favorites, setFavorites] = useState<string[]>([]);
  const theme = useTheme();

  useEffect(() => {
    const fetchNewCoins = async () => {
      try {
        const newCoins = await hyperEVMService.getNewCoins();
        setCoins(newCoins);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching coins:', error);
        setLoading(false);
      }
    };

    fetchNewCoins();
    const interval = setInterval(fetchNewCoins, 30000);

    return () => clearInterval(interval);
  }, []);

  const handleToggleFavorite = (address: string) => {
    setFavorites(prev => 
      prev.includes(address) 
        ? prev.filter(fav => fav !== address) 
        : [...prev, address]
    );
  };

  const handleSnipe = async (coin: Coin) => {
    if (!account) {
      alert('Please connect your wallet first');
      return;
    }

    try {
      // Implement advanced sniping logic here
      console.log('Sniping coin:', coin);
    } catch (error) {
      console.error('Snipe failed:', error);
      alert('Snipe failed. Please try again.');
    }
  };

  const filteredCoins = coins.filter((coin: Coin) => 
    coin.name.toLowerCase().includes(search.toLowerCase()) ||
    coin.symbol.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <Box sx={{ width: '100%', overflow: 'hidden' }}>
      <Typography variant="h4" gutterBottom>
        Token Tracker
      </Typography>

      <Box sx={{ mb: 3 }}>
        <TextField
          fullWidth
          size="small"
          placeholder="Search tokens..."
          value={search}
          onChange={(e: React.ChangeEvent<HTMLInputElement>) => setSearch(e.target.value)}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon />
              </InputAdornment>
            ),
          }}
          sx={{
            '& .MuiOutlinedInput-root': {
              '& fieldset': {
                borderColor: theme.palette.primary.main,
              },
              '&:hover fieldset': {
                borderColor: theme.palette.primary.main,
              },
              '&.Mui-focused fieldset': {
                borderColor: theme.palette.primary.main,
              },
            },
          }}
        />
      </Box>

      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', pt: 4 }}>
          <CircularProgress />
        </Box>
      ) : (
        <Grid container spacing={3}>
          {filteredCoins.map((coin: Coin) => (
            <Grid item xs={12} sm={6} md={4} lg={3} key={coin.address}>
              <Paper
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  p: 2,
                }}
              >
                <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                  <PlaceholderImage width={200} height={150} text="Coin Tracker" />
                  <Typography variant="h6" component="div">
                    {coin.name}
                  </Typography>
                  <IconButton
                    onClick={() => handleToggleFavorite(coin.address)}
                    color={favorites.includes(coin.address) ? 'primary' : 'default'}
                  >
                    <StarIcon />
                  </IconButton>
                </Box>

                <Typography variant="body1" color="text.secondary" sx={{ mb: 1 }}>
                  {coin.symbol}
                </Typography>

                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <TrendingIcon 
                    sx={{ 
                      color: coin.priceChange24h >= 0 ? '#4caf50' : '#f44336',
                      mr: 1,
                    }} 
                  />
                  <Typography 
                    variant="h6" 
                    sx={{ 
                      fontWeight: 'bold',
                      color: coin.priceChange24h >= 0 ? '#4caf50' : '#f44336',
                    }}
                  >
                    {coin.priceChange24h >= 0 ? '+' : ''}{coin.priceChange24h}%
                  </Typography>
                </Box>

                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography variant="body2" color="text.secondary">
                    Price
                  </Typography>
                  <Typography variant="body1">
                    ${coin.price.toFixed(6)}
                  </Typography>
                </Box>

                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography variant="body2" color="text.secondary">
                    Volume 24h
                  </Typography>
                  <Typography variant="body1">
                    ${coin.volume24h.toFixed(2)}
                  </Typography>
                </Box>

                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography variant="body2" color="text.secondary">
                    Liquidity
                  </Typography>
                  <Typography variant="body1">
                    ${coin.liquidity.toFixed(2)}
                  </Typography>
                </Box>

                <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                  <Typography variant="body2" color="text.secondary">
                    Holders
                  </Typography>
                  <Typography variant="body2">
                    {coin.holders}
                  </Typography>
                </Box>

                <Button
                  variant="contained"
                  fullWidth
                  onClick={() => handleSnipe(coin)}
                  disabled={!account}
                  sx={{ mt: 'auto' }}
                >
                  {account ? 'Snipe Now' : 'Connect Wallet'}
                </Button>
              </Paper>
            </Grid>
          ))}
        </Grid>
      )}
    </Box>
  );
};

export default CoinTracker;
